        <div className="navbar-fixed">
            <nav className= "navbar">
                <ul>
                    <li className= "brand">
                        <a href="/" > Memory Game </a>
                    </li>
                    <li>
                        {/* status updates will be displayed here */}
                        
                    </li>
                    <li>
                        {/* score will be displayed here */}
                        <p>Score: {score} | Top Score:  </p>
                    </li>
                </ul>
            </nav>
        </div>
    )
}

export default Nav;
